import React from 'react'
import { Link, useLocation } from 'react-router-dom'
import { Box, Button, Typography } from '@mui/material'

function ComponentB() {

    const location = useLocation();
   
        return (

            <>               
                <div>{location.state.name}</div>

            </>
        )
}

const carNumber = 1

const QuestionButton = ({text, onClick, isLastQuestion}) => {
    return (
        isLastQuestion ? 
            <Link 
                to='/quiz-complete'
                state={carNumber}
            >
                <Button 
                    variant="contained"
                >
                    <Typography variant="h6">
                        {text}
                    </Typography>
                </Button>
            </Link>
            :
            <Box 
                onClick={onClick}
                width='100%'
            >
                <Button 
                    variant="contained"
                >
                    <Typography variant="h6">
                        {text}
                    </Typography>
                </Button>
            </Box>
    )
}

export default QuestionButton
